import React from "react"; //import React library

const EXAMPLE_SENATORS = [
  {
    id: "C000127",
    name: "Maria Cantwell",
    state: "WA",
    party: "Democrat",
    phone: "202-224-3441",
    twitter: "SenatorCantwell",
  },
  {
    id: "M001111",
    name: "Patty Murray",
    state: "WA",
    party: "Democrat",
    phone: "202-224-2621",
    twitter: "PattyMurray",
  },
];

/* Your code goes here */
export function SenatorTable(props) {
  return (
    <table className="table table-bordered">
      <thead>
        <tr>
          <th>Name</th>
          <th>State</th>
          <th>Phone</th>
          <th>Twitter</th>
        </tr>
      </thead>
      <tbody>
        {props.senators.map((senator) => (
          <tr key={senator.id}>
            <td>{senator.name}</td>
            <td>{senator.state}</td>
            <td>
              <a href={`tel:${senator.phone}`}>{senator.phone}</a>
            </td>
            <td>
              <a href={`https://twitter.com/${senator.twitter}`}>
                @{senator.twitter}
              </a>
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}
